function parseToMoney(num) {
    // return num.toLocaleString('en-US');
    const [integer, decimal] = num.toString().split('.');
    let count = 0;
    let result = '';
    for (let i = integer.length - 1; i >= 0; i--) {
        result = integer[i] + result;
        count ++;
        if (count % 3 === 0 && i !== 0) {
            result = ',' + result;
        }
    }
    result = result + (decimal ? '.' + decimal : '');
    return result;
}

